import React from 'react'
import web from "../src/Images/img2.webp"
import { NavLink } from 'react-router-dom';
import Common from './Common'
const Home = () => {
    return (
        <>
        <Common name="Grow your business with"  imgsrc={web} visit='/contact' btname="Contact now"/>
        </>
    );
};
export default Home;
